import React from 'react';

function Resume() {
  return (
    <section id="resume">
      <h2>Resume</h2>
      <p>I am new to the world of coding but am ready to work hard, learn, and always grow!</p>
      <a className="resume-link"  download="./styles/Kyla Rodriguez's Resume.pdf">Download Resume</a>
    </section>
  );
}

export default Resume;
